import navbarCSS from './navbar.module.css';

function Navbar(){
    return (
    <div>
        <nav>
            <ul>
                <li><a href='#'>home</a></li>
                <li>books</li>
                <li>groups</li>
                <li>discussion</li>
                <li>profile</li>
            </ul>
        </nav>
    </div>
    );
}

export default Navbar;
